     myFunction = () => {
        this.setState({ mystate: true })
    }

    render() {
        return (
            <SecondComponent function={this.myFunction} />
        )
    }
}

export default class SecondComponent extends React.Component {

    render() {
        return (
            <div onClick={this.state.bind(this)}/>
